import React from 'react';

import { Button,Nav,Navbar, NavbarBrand, NavDropdown } from "react-bootstrap";
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "./Topbar.css";


export default function topbar() {
  return (
    <div>
       <div className="App">
        <Navbar className="bg-secondary" expand='sm'>
       
          <NavbarBrand  href='#'>
            Socialmedia App
          </NavbarBrand>
           <form>
          <input type="search" placeholder="Search"/>
          <button>Search</button>
         </form>
          <Navbar.Toggle aria-controls='ny-nav' className="text-center"/>
          <Navbar.Collapse id='my-nav' className="nav_link">
         <Nav className="fw-bold">
          <Nav.Link href='#'>Homepage</Nav.Link>
          <NavDropdown title='Profile' id='my-nav'>
            <NavDropdown.Item href='#'>settings</NavDropdown.Item>
            <NavDropdown.Item href='#'>Logout</NavDropdown.Item>
          </NavDropdown>
          <Nav.Link href='#'>Timeline</Nav.Link>
         </Nav>
         </Navbar.Collapse>
        
          
          
          </Navbar>
          </div>
        
             
    </div>
    
  );
};
